import React from "react";
import axios from "axios";
import '../style/admin.css';

const API = "https://63a5721a318b23efa793a770.mockapi.io/api/produce/";

class PageAdmin extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      product: [],
      id: null,
      name: "",
      avatar: "",
      quantity: "",
      description: "",
      showAddForm: false
    };
  }

  componentDidMount() {
    axios
      .get(API)
      .then(response => {
        this.setState({ product: response.data });
      })
      .catch(error => {
        console.log(error);
      });
  }

  setStatus = () => {
    this.setState({ showAddForm: !this.state.showAddForm });
  };

  formAddBook = () => {
    return (
      <div className="form-group">
        <label>Tên Sản phẩm</label>
        <input
          type="text"
          className="form-control"
          value={this.state.name}
          onChange={(e) => this.setState({ name: e.target.value })}
        />
        <label>Ảnh sản phẩm</label>
        <input
          type="text"
          className="form-control"
          value={this.state.avatar}
          onChange={(e) => this.setState({ avatar: e.target.value })}
        />
        <label>Gía</label>
        <input
          type="text"
          className="form-control"
          value={this.state.quantity}
          onChange={(e) => this.setState({ quantity: e.target.value })}
        />
        <label>Mô tả</label>
        <input
          type="text"
          className="form-control"
          value={this.state.description}
          onChange={(e) => this.setState({ description: e.target.value })}
        />
        <button type="submit" className="btn btn-primary" onClick={this.addBook}>Add</button>
      </div>
    );
  };

  render() {
    return (
      <div>
        <div className="container">
          <div className="row">
            <div className="col-sm-12">
              <div className="card">
                <div className="card-body">
                  <h4 className="Title_table">Quản lý sản phẩm</h4>
                  <p className="card-text">
                    <button className="btn btn-primary">
                      <a style={{ color: 'white', textDecoration: 'none' }} href={`/Add`}>Thêm sản phẩm mới</a>
                    </button>
                  </p>
                  {this.state.showAddForm ? this.formAddBook() : null}

                  <table className="table table-bordered">
                    <thead>
                      <tr>
                        <th>ID</th>
                        <th>Tên sản phẩm</th>
                        <th>Ảnh sản phẩm</th>
                        <th>Gía</th>
                        <th>Mô tả sản phẩm</th>
                        <th>Xóa</th>
                        <th>Sửa</th>
                      </tr>
                    </thead>

                    <tbody>
                      {this.state.product.map((product) => (
                        <tr key={product.id}>
                          <td>{product.id}</td>
                          <td>{product.name}</td>
                          <td><img className="img2" src={product.avatar} alt={product.name} /></td>
                          <td>{product.quantity}</td>
                          <td>{product.description}</td>
                          <td>
                                                        <button className="btn btn-primary mr-2" >
                                                            <a style={{color: 'white'}}   className="btn btn-primary mr-2" href={`/Delete/${products.id}`}>Edit</a>
                                                        </button>
                                                    </td>
                                                    <td>
                                                    <button type="submit"  className="btn btn-primary mr-2" >
                                                            <a style={{color: 'white',textDecoration:'none'}} className="btn btn-primary mr-2" href={`/Update/${products.id}`}>Delete</a>
                                                        </button>
                                                    </td>
                                                </tr>
                                            ))}
                                            </tbody>
                                    </table>
                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
             </div>
        );
     }
 }
export default PageAdmin;
